import React from 'react';

function appointmentCard(props) {
    return (


        <tr>
            <td>{props.reserv.cid}</td>
            <td>{props.reserv.date}</td>
            <td>{props.reserv.time}</td>
            <td>{props.reserv.seats}</td>
        </tr>


    )
}

export default appointmentCard;
